import logo from './logo.svg';
import './App.css';
import githubSVG from "./qr-code.svg";

function App() {
  return (
    <div className="big-container">
      <div className="toparea">
      <div className="center wrap">
        <img className="image" src={githubSVG}/>
        <img className="image" src="https://avatars.githubusercontent.com/u/60619308?v=4" />
        </div>
        <div className="center wrap">
        <h2>Swojas Bhalunkar </h2>
        <pre>    </pre>
        <a className="email" href="mailto:swojas12@gmail.com"> swojas12@gmail.com</a>
        </div>
      </div>

    <div className="container">
      <h1 className="personal" align="left">Software Developer</h1>
      <p className="personal" align="left">Enthusiastic individual with strong foundation in Software Development.</p>
    </div>
    <div className="container">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
    </div>
  );
}

export default App;
